import React, {useState} from 'react';
import {Link} from 'react-router-dom';
import './style.css'

function Nav(){
    return(

        <div>
            <nav className = "navbar">
                <div className = "navbar-container">
                    <Link to = "/" className = "navbar-logo">
                    GeoMapper <i className = 'fa-solid fa-earth-asia'></i>
                    </Link>
                </div>

            </nav>
        </div>
);
}

export default Nav;
